function my_close_right_tab(b) {
    var c = $(b).parent().children("a").attr("href");
    var d = TopRightTabs.find("a").index($('a[href="' + c + '"]'));
    if (d >= 0) {
        if (TopRightTabs) {
            if (TopRightPreviousTab) {
                TopRightTabs.tabs("select", TopRightPreviousTab)
            }
            TopRightTabs.tabs("remove", d)
        }
    }
    return false
}

