function TimeTableSlotOpenContextMenu(b, d, e) {
    if (b == "event_cr") {
        Create_New_Event(d, e);
        return
    }
    if (b == "event_ed") {
        Edit_Event(d, e);
        return
    }
    if (b == "close") {
        return
    }
    if (b == "s_open") {
        CloseOpenTimeSlot(1, $(d).attr("tc"), Planning_age_id, Planning_date, $(d).attr("id"));
        return
    }
    if (b == "s_open_all") {
        for (var c = 0; c <= 25; c++) {
            CloseOpenTimeSlotAll(1, $(d).attr("tc"), Planning_age_id, Planning_date, c)
        }
        LoadTimeTables(0);
        return
    }
}

