function formatDate_js(c) {
    var g = new Date(c),
        f = "" + (g.getMonth() + 1),
        b = "" + g.getDate(),
        e = g.getFullYear();
    if (f.length < 2) {
        f = "0" + f
    }
    if (b.length < 2) {
        b = "0" + b
    }
    return [e, f, b].join("-")
}

