function secToTime(d) {
    var b = Math.floor(d / 3600);
    var c = Math.floor((d - b * 3600) / 60);
    var e = d - b * 3600 - c * 60;
    if (b < 10) {
        b = "0" + b
    }
    if (c < 10) {
        c = "0" + c
    }
    if (e < 10) {
        e = "0" + e
    }
    return b + ":" + c + ":" + e
}

