function onlyNumbers(b) {
    var e;
    var d;
    var c;
    if (window.event) {
        e = b.keyCode
    } else {
        if (b.which) {
            e = b.which
        }
    }
    d = String.fromCharCode(e);
    c = /\d/;
    if (c.test(d)) {
        return d
    }
}

