        type: "GET",
        url: pc30_core_ws_url + "/core_ws/rest/Pc30CoreWS/findMeetingByIdInter/" + f + "/" + $.datepicker.formatDate("yy-mm-dd", b) + "/" + $.datepicker.formatDate("yy-mm-dd", h),
